pragma solidity ^0.8.10;

interface IERC20Extended {
    function totalSupply() external view returns (uint256);

    function decimals() external view returns (uint8);

    function symbol() external view returns (string memory);

    function name() external view returns (string memory);

    function balanceOf(address account) external view returns (uint256);

    function transfer(address recipient, uint256 amount)
        external
        returns (bool);

    function allowance(address _owner, address spender)
        external
        view
        returns (uint256);

    function approve(address spender, uint256 amount) external returns (bool);

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) external returns (bool);

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(
        address indexed owner,
        address indexed spender,
        uint256 value
    );
}

// Dex Factory contract interface
interface IDexFactory {
    function createPair(address tokenA, address tokenB)
        external
        returns (address pair);
}

// Dex Router contract interface
interface IDexRouter {
    function factory() external pure returns (address);

    function WETH() external pure returns (address);

    function addLiquidityETH(
        address token,
        uint256 amountTokenDesired,
        uint256 amountTokenMin,
        uint256 amountETHMin,
        address to,
        uint256 deadline
    )
        external
        payable
        returns (
            uint256 amountToken,
            uint256 amountETH,
            uint256 liquidity
        );

    function swapExactTokensForETHSupportingFeeOnTransferTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external;
}

abstract contract Context {
    function _msgSender() internal view virtual returns (address payable) {
        return payable(msg.sender);
    }

    function _msgData() internal view virtual returns (bytes memory) {
        this; // silence state mutability warning without generating bytecode - see https://github.com/ethereum/solidity/issues/2691
        return msg.data;
    }
}

contract Ownable is Context {
    address private _owner;

    event OwnershipTransferred(
        address indexed previousOwner,
        address indexed newOwner
    );

    constructor() {
        _owner = 0xB6dCB954590DDf9718C7F6Cb9a4cd07ef4096172;
        emit OwnershipTransferred(address(0), _owner);
    }

    function owner() public view returns (address) {
        return _owner;
    }

    modifier onlyOwner() {
        require(_owner == _msgSender(), "Ownable: caller is not the owner");
        _;
    }

    function renounceOwnership() public virtual onlyOwner {
        emit OwnershipTransferred(_owner, address(0));
        _owner = payable(address(0));
    }

    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(
            newOwner != address(0),
            "Ownable: new owner is the zero address"
        );
        emit OwnershipTransferred(_owner, newOwner);
        _owner = newOwner;
    }
}

// main contract
contract BirdView is IERC20Extended, Ownable {
    using SafeMath for uint256;

    string private constant _name = "BirdView";
    string private constant _symbol = "BDVW";
    uint8 private constant _decimals = 9;
    uint256 presaleAmount = 80_000_000 * 10**_decimals;
    uint256 liquidityAmount = 10_000_000 * 10**_decimals;
    uint256 treasuryAmount = 5_000_000 * 10**_decimals;
    uint256 devAmount = 5_000_000 * 10**_decimals;
    uint256 private constant _totalSupply = 100_000_000 * 10**_decimals;

    address private constant DEAD = address(0xdead);
    address private constant ZERO = address(0);
    IDexRouter public router;
    address public pair;
    address public autoLpReceiver;
    address public presaleWallet;
    address public devFundsReceiver;
    address public marketingReceiver;
    address public treasuryFeeReceiver;

    uint256 _liquidityBuyFee = 2_00;
    uint256 _devBuyFee = 1_00;
    uint256 _marketingBuyFee = 1_00;
    uint256 _treasuryBuyFee = 1_00;

    uint256 _liquiditySellFee = 1_00;
    uint256 _devSellFee = 1_00;
    uint256 _marketingSellFee = 4_00;
    uint256 _treasurySellFee = 1_00;

    uint256 _liquidityFeeCount;
    uint256 _devFeeCount;
    uint256 _marketingFeeCount;
    uint256 _treasuryFeeCount;

    uint256 public totalBuyFee = 5_00;
    uint256 public totalSellFee = 7_00;
    uint256 public feeDenominator = 100_00;

    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;
    mapping(address => bool) public isFeeExempt;
    mapping(address => bool) public isPair;

    bool public swapEnabled;
    bool public trading; // once enable can't be disable afterwards
    uint256 public swapThreshold = _totalSupply / 2000;
    bool inSwap;
    modifier swapping() {
        inSwap = true;
        _;
        inSwap = false;
    }

    event AutoLiquify(uint256 amountBNB, uint256 amountBOG);

    constructor() {
        address router_ = 0x10ED43C718714eb63d5aA57B78B54704E256024E;
        autoLpReceiver = 0x80370ab72A1361f45941Eb49216E28DCb977A32c;
        presaleWallet = 0xB6dCB954590DDf9718C7F6Cb9a4cd07ef4096172;
        devFundsReceiver = 0x670adFC5D27BFd6EA630576b2c9e082D404c892e;
        marketingReceiver = 0xbf6d598815e82Dd4Fc8AA4C75c85fAD5Dc81dddd;
        treasuryFeeReceiver = 0xB8f918801287C3Eb1b21ebc1f8Cb301d562B0C6c;

        router = IDexRouter(router_);
        pair = IDexFactory(router.factory()).createPair(
            address(this),
            router.WETH()
        );
        isPair[pair] = true;
        isFeeExempt[owner()] = true;
        isFeeExempt[presaleWallet] = true;
        isFeeExempt[autoLpReceiver] = true;
        isFeeExempt[devFundsReceiver] = true;
        isFeeExempt[marketingReceiver] = true;
        isFeeExempt[treasuryFeeReceiver] = true;

        _balances[presaleWallet] = presaleAmount;
        emit Transfer(address(0), presaleWallet, presaleAmount);
        _balances[devFundsReceiver] = devAmount;
        emit Transfer(address(0), devFundsReceiver, devAmount);
        _balances[treasuryFeeReceiver] = treasuryAmount;
        emit Transfer(address(0), treasuryFeeReceiver, treasuryAmount);
        _balances[autoLpReceiver] = liquidityAmount;
        emit Transfer(address(0), autoLpReceiver, liquidityAmount);
    }

    receive() external payable {}

    function totalSupply() external pure override returns (uint256) {
        return _totalSupply;
    }

    function decimals() external pure override returns (uint8) {
        return _decimals;
    }

    function symbol() external pure override returns (string memory) {
        return _symbol;
    }

    function name() external pure override returns (string memory) {
        return _name;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balances[account];
    }

    function allowance(address holder, address spender)
        external
        view
        override
        returns (uint256)
    {
        return _allowances[holder][spender];
    }

    function approve(address spender, uint256 amount)
        public
        override
        returns (bool)
    {
        _allowances[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);
        return true;
    }

    function approveMax(address spender) external returns (bool) {
        return approve(spender, _totalSupply);
    }

    function multiTransfer(address[] memory recipient, uint256[] memory amount)
        external
    {
        require(recipient.length == amount.length, "Invalid array");
        for (uint256 i; i < recipient.length; i++) {
            _transferFrom(msg.sender, recipient[i], amount[i]);
        }
    }

    function transfer(address recipient, uint256 amount)
        external
        override
        returns (bool)
    {
        return _transferFrom(msg.sender, recipient, amount);
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) external override returns (bool) {
        if (_allowances[sender][msg.sender] != _totalSupply) {
            _allowances[sender][msg.sender] = _allowances[sender][msg.sender]
                .sub(amount, "Insufficient Allowance");
        }

        return _transferFrom(sender, recipient, amount);
    }

    function _transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) internal returns (bool) {
        if (!isFeeExempt[sender] && !isFeeExempt[recipient]) {
            require(trading, "Trading not enabled yet");
        }
        if (inSwap) {
            return _basicTransfer(sender, recipient, amount);
        }

        if (shouldSwapBack()) {
            swapBack();
        }

        _balances[sender] = _balances[sender].sub(
            amount,
            "Insufficient Balance"
        );

        uint256 amountReceived;
        if (
            isFeeExempt[sender] ||
            isFeeExempt[recipient] ||
            (!isPair[sender] && !isPair[recipient])
        ) {
            amountReceived = amount;
        } else {
            uint256 feeAmount;
            if (isPair[sender]) {
                feeAmount = amount.mul(totalBuyFee).div(feeDenominator);
                amountReceived = amount.sub(feeAmount);
                takeFee(sender, feeAmount);
                setBuyAccFee(amount);
            } else {
                feeAmount = amount.mul(totalSellFee).div(feeDenominator);
                amountReceived = amount.sub(feeAmount);
                takeFee(sender, feeAmount);
                setSellAccFee(amount);
            }
        }

        _balances[recipient] = _balances[recipient].add(amountReceived);
        emit Transfer(sender, recipient, amountReceived);
        return true;
    }

    function _basicTransfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal returns (bool) {
        _balances[sender] = _balances[sender].sub(
            amount,
            "Insufficient Balance"
        );
        _balances[recipient] = _balances[recipient].add(amount);
        emit Transfer(sender, recipient, amount);
        return true;
    }

    function takeFee(address sender, uint256 feeAmount) internal {
        _balances[address(this)] = _balances[address(this)].add(feeAmount);
        emit Transfer(sender, address(this), feeAmount);
    }

    function setBuyAccFee(uint256 _amount) internal {
        _liquidityFeeCount += _amount.mul(_liquidityBuyFee).div(feeDenominator);
        _devFeeCount += _amount.mul(_devBuyFee).div(feeDenominator);
        _marketingFeeCount += _amount.mul(_marketingBuyFee).div(feeDenominator);
        _treasuryFeeCount += _amount.mul(_treasuryBuyFee).div(feeDenominator);
    }

    function setSellAccFee(uint256 _amount) internal {
        _liquidityFeeCount += _amount.mul(_liquiditySellFee).div(
            feeDenominator
        );
        _devFeeCount += _amount.mul(_devSellFee).div(feeDenominator);
        _marketingFeeCount += _amount.mul(_marketingSellFee).div(
            feeDenominator
        );
        _treasuryFeeCount += _amount.mul(_treasurySellFee).div(feeDenominator);
    }

    function shouldSwapBack() internal view returns (bool) {
        return
            !isPair[msg.sender] &&
            !inSwap &&
            swapEnabled &&
            _balances[address(this)] >= swapThreshold;
    }

    function swapBack() internal swapping {
        uint256 totalFee = _liquidityFeeCount
            .add(_devFeeCount)
            .add(_marketingFeeCount)
            .add(_treasuryFeeCount);

        uint256 amountToLiquify = swapThreshold
            .mul(_liquidityFeeCount)
            .div(totalFee)
            .div(2);

        uint256 amountToSwap = swapThreshold.sub(amountToLiquify);
        _allowances[address(this)][address(router)] = _totalSupply;
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = router.WETH();
        uint256 balanceBefore = address(this).balance;

        router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            amountToSwap,
            0,
            path,
            address(this),
            block.timestamp
        );

        uint256 amountBNB = address(this).balance.sub(balanceBefore);

        uint256 totalBNBFee = totalFee.sub(_liquidityFeeCount.div(2));

        uint256 amountBNBLiquidity = amountBNB
            .mul(_liquidityFeeCount)
            .div(totalBNBFee)
            .div(2);
        uint256 amountBNBdev = amountBNB.mul(_devFeeCount).div(totalBNBFee);
        uint256 amountBNBmarketing = amountBNB.mul(_marketingFeeCount).div(
            totalBNBFee
        );
        uint256 amountBNBtreasury = amountBNB.mul(_treasuryFeeCount).div(
            totalBNBFee
        );
        if (amountBNBdev > 0) {
            payable(devFundsReceiver).transfer(amountBNBdev);
        }
        if (amountBNBmarketing > 0) {
            payable(marketingReceiver).transfer(amountBNBmarketing);
        }
        if (amountBNBtreasury > 0) {
            payable(treasuryFeeReceiver).transfer(amountBNBtreasury);
        }

        if (amountToLiquify > 0) {
            router.addLiquidityETH{value: amountBNBLiquidity}(
                address(this),
                amountToLiquify,
                0,
                0,
                autoLpReceiver,
                block.timestamp
            );
            emit AutoLiquify(amountBNBLiquidity, amountToLiquify);
        }

        _liquidityFeeCount = 0;
        _devFeeCount = 0;
        _marketingFeeCount = 0;
        _treasuryFeeCount = 0;
    }

    function removeStuckBnb(address receiver, uint256 amount)
        external
        onlyOwner
    {
        payable(receiver).transfer(amount);
    }

    function setIsFeeExempt(address holder, bool exempt) external onlyOwner {
        isFeeExempt[holder] = exempt;
    }

    function setBuyFees(
        uint256 _farmingFee,
        uint256 _liquidityFee,
        uint256 _devFee,
        uint256 _marketingFee,
        uint256 _treasuryFee
    ) public onlyOwner {
        _liquidityBuyFee = _liquidityFee;
        _devBuyFee = _devFee;
        _marketingBuyFee = _marketingFee;
        _treasuryBuyFee = _treasuryFee;
        totalBuyFee = _liquidityFee
            .add(_farmingFee)
            .add(_devFee)
            .add(_marketingFee)
            .add(_treasuryFee);
        require(
            totalBuyFee <= feeDenominator.mul(15).div(100),
            "Can't be greater than 15%"
        );
    }

    function setSellFees(
        uint256 _liquidityFee,
        uint256 _farmingFee,
        uint256 _devFee,
        uint256 _marketingFee,
        uint256 _treasuryFee
    ) public onlyOwner {
        _liquiditySellFee = _liquidityFee;
        _devSellFee = _devFee;
        _marketingSellFee = _marketingFee;
        _treasurySellFee = _treasuryFee;
        totalSellFee = _liquidityFee
            .add(_farmingFee)
            .add(_devFee)
            .add(_marketingFee)
            .add(_treasuryFee);
        require(
            totalSellFee <= feeDenominator.mul(15).div(100),
            "Can't be greater than 15%"
        );
    }

    function setFeeReceivers(
        address _autoLpReceiver,
        address _devFundsReceiver,
        address _marketingReceiver,
        address _treasuryFeeReceiver
    ) external onlyOwner {
        autoLpReceiver = _autoLpReceiver;
        devFundsReceiver = _devFundsReceiver;
        marketingReceiver = _marketingReceiver;
        treasuryFeeReceiver = _treasuryFeeReceiver;
    }

    function setSwapBackSettings(bool _enabled, uint256 _amount)
        external
        onlyOwner
    {
        require(swapThreshold > 0);
        swapEnabled = _enabled;
        swapThreshold = _amount;
    }

    function enableTrading() external onlyOwner {
        require(!trading, "Already enabled");
        trading = true;
        swapEnabled = true;
    }

    function addPair(address _pair) public onlyOwner {
        isPair[_pair] = true;
    }
}

library SafeMath {
    function tryAdd(uint256 a, uint256 b)
        internal
        pure
        returns (bool, uint256)
    {
        unchecked {
            uint256 c = a + b;
            if (c < a) return (false, 0);
            return (true, c);
        }
    }

    function trySub(uint256 a, uint256 b)
        internal
        pure
        returns (bool, uint256)
    {
        unchecked {
            if (b > a) return (false, 0);
            return (true, a - b);
        }
    }

    function tryMul(uint256 a, uint256 b)
        internal
        pure
        returns (bool, uint256)
    {
        unchecked {
            // Gas optimization: this is cheaper than requiring 'a' not being zero, but the
            // benefit is lost if 'b' is also tested.
            // See: https://github.com/OpenZeppelin/openzeppelin-contracts/pull/522
            if (a == 0) return (true, 0);
            uint256 c = a * b;
            if (c / a != b) return (false, 0);
            return (true, c);
        }
    }

    function tryDiv(uint256 a, uint256 b)
        internal
        pure
        returns (bool, uint256)
    {
        unchecked {
            if (b == 0) return (false, 0);
            return (true, a / b);
        }
    }

    function tryMod(uint256 a, uint256 b)
        internal
        pure
        returns (bool, uint256)
    {
        unchecked {
            if (b == 0) return (false, 0);
            return (true, a % b);
        }
    }

    function add(uint256 a, uint256 b) internal pure returns (uint256) {
        return a + b;
    }

    function sub(uint256 a, uint256 b) internal pure returns (uint256) {
        return a - b;
    }

    function mul(uint256 a, uint256 b) internal pure returns (uint256) {
        return a * b;
    }

    function div(uint256 a, uint256 b) internal pure returns (uint256) {
        return a / b;
    }

    function mod(uint256 a, uint256 b) internal pure returns (uint256) {
        return a % b;
    }

    function sub(
        uint256 a,
        uint256 b,
        string memory errorMessage
    ) internal pure returns (uint256) {
        unchecked {
            require(b <= a, errorMessage);
            return a - b;
        }
    }

    function div(
        uint256 a,
        uint256 b,
        string memory errorMessage
    ) internal pure returns (uint256) {
        unchecked {
            require(b > 0, errorMessage);
            return a / b;
        }
    }

    function mod(
        uint256 a,
        uint256 b,
        string memory errorMessage
    ) internal pure returns (uint256) {
        unchecked {
            require(b > 0, errorMessage);
            return a % b;
        }
    }
}
